        //}





    render() { 

        return ( 

            <Map
            google={this.props.google}
                zoom={5}
                style={{
                    width: '50%',
                    height: '50%',
                }}
                initialCenter={{lat:47.444,lng:-122.176}}            
            >
              
                {this.displayer}
                </Map>



         );
    }
}

 
export default GoogleApiWrapper({
    apiKey: 'AIzaSyAF6LzDWnCO0yQ3_xVfXMYicN6MqUFl4q0'
}) (MapContainer);
